import React from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './Page2.css';

const Page2 = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { user } = location.state || {};

  const handleLogout = () => {
    // In a real app, you might want to clear auth tokens here
    navigate('/');
  };

  const handleSubmit = () => {
    // Here you would typically submit form data to your backend
    // Then redirect to login
    navigate('/');
  };

  return (
    <div className="page2-container">
      <h1>Welcome to Page 2</h1>
      {user && (
        <div className="user-info">
          <p>Logged in as: <strong>{user.email}</strong></p>
        </div>
      )}
      <div className="page2-content">
        <p>This is the second page of your application.</p>
        <div className="button-group">
          <button onClick={handleLogout} className="logout-button">
            Logout
          </button>
          <button onClick={handleSubmit} className="submit-button">
            Submit
          </button>
          <Link to="/page1" state={{ user }} className="nav-button">
            Back to Page 1
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Page2;
